function openConnect(connection,element,color){var tabcontent=document.getElementsByClassName("tabcontent");for(var i=0;i<tabcontent.length;i+=1){tabcontent[i].style.display="none"}var tablinks=document.getElementsByClassName("tablink");for(var i=0;i<tablinks.length;i+=1){tablinks[i].style.backgroundColor=""}document.getElementById(connection).style.display="block";element.style.backgroundColor=color}function onLoad(){$(document).ready(function(){$("#defaultOpen").click()})}$(window).on('beforeunload',function(){var c=confirm();if(c){return true}else{return false}});